import React, { useContext } from "react";
import InputButton from "../../css/styled/button";
import Nav from "../../css/styled/bar";

import "../../css/nav.css";
import SortingContext from "../../context/sortingContext";

// Navbar Component
const Navbar = () => {
  const { config } = useContext(SortingContext);

  const selectAlgorithm = () => {
    const updateAlgorithm = (e) => {
      e.setAlgorithm(e.target.value);
    };
    <Nav value={config.algorithm}>
      <>
        <InputButton id="but_heap" onClick={updateAlgorithm}>
          Heap Sort
        </InputButton>
        <InputButton id="but_bubble">Bubble Sort</InputButton>
        <InputButton id="but_quick">Quick Sort</InputButton>
        <InputButton id="but_merge">Merge Sort</InputButton>
        <InputButton id="but_insertions">Insertion Sort</InputButton>
      </>
    </Nav>;
  };

  // <div className="array-inputs"></div>
  // <Button id="a_generate" onClick={() => props.resetHandler()}>
  //   Generate New Array
  // </Button>

  const selectSpeed = () => {};

  const selectSize = () => {};

  return <></>;
};

export default Navbar;
